import React from "react";


export class Nav extends React.Component{
    constructor(props){
        super(props);
        this.menu_nav = {
            "Esto es una seccion": ["Una SubDivision","Otra Subdivision"],
            "Esto es otra division": ["Una SubDivision","Otra SubDivision"]
        }
    }
    render(){
        return(
            <React.StrictMode>
                <ul>
                    {
                        console.log(this.menu_nav)
                    }
                </ul>
            </React.StrictMode>
        )
    }

}
